        #region DESCARGARNDO LOS ARCHIVOS SUBIDO
        public List<FileVM> PruebaArchivo()
        {
            //https://www.youtube.com/watch?v=vEFlCpSqVL4 <= Reference

            string[] filepaths = Directory.GetFiles(Path.GetFullPath(Path.Combine(Directory.GetCurrentDirectory(), "File")));

            var list = new List<FileVM>();
            foreach (var item in filepaths)
            {
                list.Add(new FileVM
                {
                   FileName = Path.GetFileName(item)
                });
            }
            return list;
        }

        public IActionResult DescargarArchivo(string filename)
        {
            var path = Path.GetFullPath(Path.Combine(Directory.GetCurrentDirectory(), "File\\")) + filename;
            byte[] bytes = System.IO.File.ReadAllBytes(path);
            return File(bytes, "application/octet-stream", filename);
        }

